package milliwatt.phuc.wrapper;

public class VongLapForEach {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] mang = {1,2,3,4,5};
		for(int x : mang) {
			System.out.println(x);
		}
		String[] sts = {"Xin chao","Trung tam", "java"};
		for (String s: sts) {
			System.out.println(s);
		}
		
	}

}
